goog.provide("goog.json.NativeJsonProcessor");goog.require("goog.asserts");goog.require("goog.json.Processor");goog.json.NativeJsonProcessor=function(opt_replacer,opt_reviver){goog.asserts.assert(goog.isDef(goog.global.JSON),"JSON not defined");this.replacer_=opt_replacer;this.reviver_=opt_reviver};goog.json.NativeJsonProcessor.prototype.stringify=function(object){return goog.global.JSON.stringify(object,this.replacer_)};goog.json.NativeJsonProcessor.prototype.parse=function(s){return goog.global.JSON.parse(s,this.reviver_)};